$(function () {

    "use strict";


    $(document).ready(function () {

        // preloader 
        setTimeout(function () {
            $('.preloader').fadeOut();
        }, 600);

        // menu toggle btn 
        $('.btn-menu').click(function () {
            $('.fixed-menu').addClass('open');
        });

        $('.btn-close').click(function () {
            $('.fixed-menu').removeClass('open');
        });

        $(window).resize(function () {
            var ww = $(window).width();
            if (ww > 1200) {
                $('.fixed-menu').removeClass('open');


            }
        });

        var countDownDate = new Date("Aug 10, 2021 10:00:00").getTime();
        var nowDate = new Date().getTime();
        var distance = countDownDate - nowDate;

        // clock
        var clock = $('.timer').FlipClock(distance/1000, {
            clockFace: 'DailyCounter',
            countdown: true
        });

        // custom select
        $('.select').each(function () {
            var $this = $(this), numberOfOptions = $(this).children('option').length;

            $this.addClass('select-hidden');
            $this.wrap('<div class="select"></div>');
            $this.after('<div class="select-styled"></div>');

            var $styledSelect = $this.next('div.select-styled');
            $styledSelect.text($this.children('option').eq(0).text());

            var $list = $('<ul />', {
                'class': 'select-options'
            }).insertAfter($styledSelect);

            for (var i = 0; i < numberOfOptions; i++) {
                $('<li />', {
                    text: $this.children('option').eq(i).text(),
                    rel: $this.children('option').eq(i).val()
                }).appendTo($list);
            }

            var $listItems = $list.children('li');

            $styledSelect.click(function (e) {
                e.stopPropagation();
                $('div.select-styled.active').not(this).each(function () {
                    $(this).removeClass('active').next('ul.select-options').hide();
                });
                $(this).toggleClass('active').next('ul.select-options').fadeToggle();
            });

            $listItems.click(function (e) {
                e.stopPropagation();
                $styledSelect.text($(this).text()).removeClass('active');
                $this.val($(this).attr('rel'));
                $list.fadeOut();
                //console.log($this.val());
            });

            $(document).click(function () {
                $styledSelect.removeClass('active');
                $list.fadeOut();
            });

        });



        // press  carousel 

        $(".press-carousel").owlCarousel({
            items: 1,
            dots: true,
        });

        // news carousel 

        $(".news-carousel").owlCarousel({
            items: 3,
            margin: 30,
            dots: true,
            responsive: {
                0: {
                    items: 1,
                },
                768: {
                    items: 2,
                },
                992: {
                    items: 3,
                }
            }
        });

        // counter up values
        $('.counter').countUp({
            'time': 2000,
            'delay': 10
        });

        $('.popup-youtube').magnificPopup({
            type: 'iframe',
            mainClass: 'mfp-fade',
            removalDelay: 160,
            preloader: false,

            fixedContentPos: false
        });

        // scroll 
        $('.menu__link').on('click', function (event) {

            var target = $(this.getAttribute('href'));
            if (target.length) {
                event.preventDefault();

                $('html, body').stop().animate({
                    scrollTop: target.offset().top - 90
                }, 1000);


            }

        });

        $('.mob-menu__link').on('click', function (event) {
            var target = $(this.getAttribute('href'));
            if (target.length) {
                event.preventDefault();
                $('html, body').stop().animate({
                    scrollTop: target.offset().top - 100
                }, 1000);
                $('.fixed-menu').removeClass('open');
            }
        });

        // scroll down btn

        $('.scroll-down').on('click', function (e) {
            $('html, body').animate({
                scrollTop: getHeight()
            }, 1000);
        });

        // accordion
        $('.accordion > li:eq(0) a').addClass('active').next().slideDown();

        $('.accordion a').click(function (j) {
            var dropDown = $(this).closest('li').find('p');

            $(this).closest('.accordion').find('p').not(dropDown).slideUp();

            if ($(this).hasClass('active')) {
                $(this).removeClass('active');
            } else {
                $(this).closest('.accordion').find('a.active').removeClass('active');
                $(this).addClass('active');
            }

            dropDown.stop(false, true).slideToggle();

            j.preventDefault();
        });

        // check inputs
        $(".form__input, .form__textarea").focus(function () {
            $(this).addClass("in");
        });
        $(".form__input, .form__textarea").focusout(function () {
            if ($.trim($(this).val()) == '') {
                $(this).removeClass('in')
            }
        });

        // form validation
        $("#contact-form").validate({
            rules: {
                Email: {
                    required: true,
                },
            },
            messages: {
                Email: {
                    required: "",
                },
            },
            submitHandler: function (form) {
                $.ajax({
                    type: "POST",
                    url: "/mail.php",
                    data: $(form).serialize(),
                    success: function () {
                        alert('Message sent');
                    }
                });
                return false; // required to block normal submit since you used ajax
            }
        });

        $("#subscribe-form").validate({
            rules: {
                subscribe_email: {
                    required: true,
                },
            },
            messages: {
                subscribe_email: {
                    required: "",
                },
            },
            submitHandler: function (form) {
                $.ajax({
                    type: "POST",
                    url: "/mail.php",
                    data: $(form).serialize(),
                    success: function () {
                        alert('Message sent');
                    }
                });
                return false; // required to block normal submit since you used ajax
            }
        });

        // charts

        var ctx = document.getElementById("myChart");
        var myChart = new Chart(ctx, {
            type: 'doughnut',
            data: {
                labels: ["5% Marketing, Airdrop", "5% Seed Round", "5% Private Sale", "10% PreSale", "10% Staking", "10% Farming", "5% Team", "50% Burning"],
                datasets: [{
                    label: '# of Votes',
                    data: [5, 5, 5, 10, 10, 10, 5, 50],
                    backgroundColor: [
                        '#ba0cd8',
                        '#ff9800',
                        '#cbde08',
                        '#00b907',
                        '#008eff',
                        '#7c3deb',
                        '#eb145d',
                        '#860000',
                    ],

                }]
            },
            options: {
                legend: {
                    display: false
                },
                elements: {
                    arc: {
                        borderColor: '#400000',
                        borderWidth: 2
                    }
                }
            }
        });

        // jarallax
        $('.jarallax').jarallax({
            speed: 0.6
        });

        // $(window).resize(function(){
        // 	var ww = $(window).width();
        // 	if(ww > 992) {

        // 	}
        // });

        // animation
        AOS.init({
            disable: 'mobile',
            duration: 1000,
            once: true
        });


    });

});

// sticky header
var $window = $(window);

function getHeight() {
    return $('.promo').outerHeight();
}

$window.on('scroll', function () {
    if ($window.scrollTop() > 1) {
        $('.header').addClass('sticky');
    } else {
        $('.header').removeClass('sticky');
    }
});
